/*

This generates ../the-graph/font-awesome-unicode-map.js for use in our SVG

*/

fs = require('fs');

var generateFile = function (err, data) {
  if (err) {
    throw err;
  }

  var linePattern = /@fa-var-[^;]*/g;
  var lines = data.match(linePattern);
  var icons = {};
  lines.forEach(function (line) {
    var namePattern = /@fa-var-(.*): \"\\(.*)\"/;
    var match = namePattern.exec(line);
    if (match) {
      var key = match[1];
      var u = "%u" + match[2];
      u = unescape(u);
      icons[ key ] = u;
    }
  });

  var output = "/*\n  this file generated by ../scripts/build-font-awesome-javascript.js \n*/\n\n"+
    "(function (context) {\n"+
    "\"use strict\";\n\n"+
    "context.TheGraph.FONT_AWESOME = "+JSON.stringify(icons, null, 2)+";\n\n"+
    "})(this);";

  fs.writeFile(__dirname+'/app/scripts/font-awesome-unicode-map.js', output, function (err) {
    if (err) {
      throw err;
    }
    console.log('Font Awesome icons map saved with ' + Object.keys(icons).length + ' icons and aliases.');
  });
};

fs.readFile( __dirname+'/app/bower_components/fontawesome/less/variables.less', 'utf8', generateFile );

global.define = function ( name, value, exportsObject )
{
    if ( !exportsObject )
    {
        if ( exports.exportsObject )
            exportsObject = exports.exportsObject;
        else 
            exportsObject = exports;        
    }

    Object.defineProperty( exportsObject, name, {
        'value': value,
        'enumerable': true,
        'writable': false,
    });
}

exports.exportObject = null;

